import React from 'react';
import { NavLink } from 'react-router-dom';
import Button from './Button';
import '../style/home.css';

function App() {
  return (
    <div className="App">
      <div className="HomeBody">
        <main>
          <Button text="ACCUEIL" />
        </main>
        <div className='HomeText'>
          <p>Bienvenue sur mon PortFolio !<br />Ici j'ai répertorié tous les <NavLink to="/projects" className="TextLink">projets</NavLink> qui me tenaient à coeur.<br />J'ai également listé mes <NavLink to="/skills" className="TextLink">compétences</NavLink>.</p>
        </div>
        <div className='Resume'>
          <h1>À Propos de Moi</h1>
          <p>Je m'appelle Mathis Coutaye et je suis actuellement étudiant en première année à Epitech Réunion
            <br />et je suis à la recherche d'un stage rémunéré d'une durée de 4 à 6 mois, à partir du 1er Juillet.
            <br />J'ai plusieurs passions comme tout ce qui tourne autour de l'informatique, soit les Jeux Vidéos ou encore la Photographie (La majorité des photos que vous verrez sur le site sont les miennes).</p>
        </div>
      </div>
    </div>
  );
}

export default App;
